import './App.css';
import axios from 'axios';

function App() {

  const fetchDictionaryAPI = async() => {
    try{
      const data = await axios.get("https://api.dictionaryapi.dev/api/v2/entries/en/hello");
      console.log(data);
    }catch(error){
      console.log(error);
    }
  }

  return (
    <div className="App">

    </div>
  );
}

export default App;
